import React from 'react'
import './NavBar.css'

type LinkValue = {
    name: string;
    path: string;
  }

interface NavBarProps {
    renderLinks: (links: LinkValue[]) => JSX.Element[]
}

const NavBar: React.FC<NavBarProps> = props => {
    return (
        <div id="NavBar">
            <h1>Lynette's Skin Studio</h1>
            <ul>
                { props.renderLinks }
            </ul>
        </div>
    )
}

export default NavBar
